import React, { useState } from 'react';

export const Reminders = () => {
  const [reminders, setReminders] = useState([]);
  const [form, setForm] = useState({
    message: '',
    interval: '',
    startTime: '',
    endTime: '',
    days: []
  });

  const [showForm, setShowForm] = useState(false);

  const daysOfWeek = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const toggleDay = (day) => {
    setForm((prev) => ({
      ...prev,
      days: prev.days.includes(day)
        ? prev.days.filter(d => d !== day)
        : [...prev.days, day]
    }));
  };

  const handleAddReminder = () => {
    if (!form.message || !form.interval) return;
    setReminders([...reminders, { ...form, id: Date.now() }]);
    setForm({
      message: '',
      interval: '',
      startTime: '',
      endTime: '',
      days: []
    });
    setShowForm(false);
  };

  const handleDelete = (id) => {
    setReminders(reminders.filter(rem => rem.id !== id));
  };

  return (
    <div className="p-10 max-w-5xl mx-auto font-sans">
      <h1 className="text-3xl font-bold mb-6">Reminders</h1>

      <div className="mb-6">
        <button
          onClick={() => setShowForm(!showForm)}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          {showForm ? 'Cancel' : 'Add Reminder'}
        </button>
      </div>

      {showForm && (
        <div className="bg-white shadow p-6 rounded border mb-8 space-y-4">
          <input
            type="text"
            name="message"
            placeholder="Reminder message"
            value={form.message}
            onChange={handleChange}
            className="border p-2 rounded w-full"
          />
          <input
            type="number"
            name="interval"
            placeholder="Interval (minutes)"
            value={form.interval}
            onChange={handleChange}
            className="border p-2 rounded w-full"
          />
          <div className="flex space-x-4">
            <input
              type="time"
              name="startTime"
              value={form.startTime}
              onChange={handleChange}
              className="border p-2 rounded"
            />
            <input
              type="time"
              name="endTime"
              value={form.endTime}
              onChange={handleChange}
              className="border p-2 rounded"
            />
          </div>
          <div className="flex flex-wrap gap-2">
            {daysOfWeek.map(day => (
              <button
                key={day}
                type="button"
                onClick={() => toggleDay(day)}
                className={`px-3 py-1 rounded border ${
                  form.days.includes(day)
                    ? 'bg-blue-600 text-white'
                    : 'bg-gray-100'
                }`}
              >
                {day}
              </button>
            ))}
          </div>
          <button
            onClick={handleAddReminder}
            className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
          >
            Save Reminder
          </button>
        </div>
      )}

      <div>
        {reminders.length === 0 ? (
          <p className="text-gray-500">No reminders yet.</p>
        ) : (
          <ul className="space-y-4">
            {reminders.map((reminder) => (
              <li key={reminder.id} className="bg-white shadow p-4 border rounded">
                <div className="font-semibold text-lg mb-1">{reminder.message}</div>
                <div className="text-sm text-gray-600">
                  Every {reminder.interval} min<br />
                  From {reminder.startTime || '--:--'} to {reminder.endTime || '--:--'}<br />
                  Days: {reminder.days.join(', ') || 'None'}
                </div>
                <button
                  onClick={() => handleDelete(reminder.id)}
                  className="mt-2 text-sm text-red-500 hover:underline"
                >
                  Delete
                </button>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};
